import React from "react"

class Categories extends React.Component{


    render(){

        return(
            <div className="categories"><h5>Category filters</h5>
                <button>All</button>
                <button>Code</button>
                <button>Food</button>
                <button>Money</button>
                <button className="selected">Misc</button>
            </div>

        )

    }

}

export default Categories
